import React, { useState, useEffect } from 'react';


function Login() {

    const [data, setData] = useState({ hits: [] });

    useEffect(async () => {
        const result = await axios(
            'http://localhost:5000/users/login',
        );

        setData(result.data);
    });

    return (
        <div className="App">
            <form>
                <input type="text" />
                <input type="password" />
                <button>LOG IN</button>
            </form>
        </div>
    );
}

export default Login;
